import React from "react";
import { Link } from "react-router-dom";

function Item({ note }) {
  return (
    <div class="flex items-center h-[45px] px-4 hover:bg-gray-100 border-t-2 rounded-xl transition-all">
      <Link to={`/note/${note.id}`}>
        <h2>{note.body.slice(0,50)}</h2>
      </Link>
    </div>
  );
}

export default Item;
